          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCkta88EhChePO0G4JRIEkJ5A0BuxSvzrTAKDsLFt_0=s128-c0x00000000-cc-rp-mo-ba3',
          rating: 4,
          relative_time_description: '4 months ago',
          text: 'I visited with my dog.\nDogs are passed through a large separate room. Everyone in the shop loves dogs and was very cute and even gave me jerky. Both craft beer and soba were delicious! All-you-can-eat is recommended.',
