          rating: 4,
          relative_time_description: 'a year ago',
          text: 'I visited on the way back from the crab tour and offered a mini set of 3 plates of Izushi plate soba called a snack set. There is a little discount for tours. I ordered only coffee, but when I looked at the other people, soba hot water was also provided properly. It may be good when you are hungry.',
