          profile_photo_url:
            'https://lh3.googleusercontent.com/a/AEdFTp6DBo75yCUA2n7sjyzLRaLNpsqaZysG-yYU5EHo=s128-c0x00000000-cc-rp-mo',
          rating: 4,
          relative_time_description: 'a year ago',
          text: "Go to Shiroyama Garden to eat Izushi soba\ncame. The store staff gave me directions over the phone and even greeted me because I had to understand. The staff was kind enough to let me in with my dog. I think it's a good place to take a walk with your dog after eating and take a drive.",
