          text: 'Came here with a friend of mine on our trip around Kyoto. The staff were very helpful in recommending different food and beers. The food was really good and the sausage was quite tasty. However, the beers were a bit hit or miss. The Weizen/ Smoke Porter were quite tasty and flavorful/brown ale was a bit more hop forward but lacking in malt flavor. The red IPA was missing a bit of flavor as well as the single hop galaxy. I think this place has some potential.',
