          rating: 5,
          relative_time_description: '3 months ago',
          text: "Excellent small local craft brewery with a great selection of beers. They have a variety on tap and in bottles. You can take away bottles as well. We tried the Biwako Hazy IPA, Momo Ale, and the Koji Ale and all were delicious! I recommend the karage and gobo fries to pair with your beer! I must say the staff were absolutely amazing. They were so friendly and even gave my nephew some chalk to draw on the chalkboard below the register. A true gem in the neighborhood. Once you're done, go down a few blocks to visit Ukimido Temple.",
