          profile_photo_url:
            'https://lh3.googleusercontent.com/a/AEdFTp535Aag1tki2opG5Uf1Wqm0KUWI9EkDljJEXC5f=s128-c0x00000000-cc-rp-mo',
          rating: 5,
          relative_time_description: '2 years ago',
          text: 'Kansai beer royalty. Whether you’re out at the source enjoying a slew of brews for your bucks party or being surprised by beers delivered in the mail on your birthday, Minoh beer will not disappoint when it comes to fresh, seasonal, unique and delicious brews. Also the food is very tasty (I recommend the yuzu sausage and the chicken) and I love the atmosphere of this venue. Plus they have a solid merch store and you can even buy roadies for the lovely walk back to the station (which I always do) Here’s to many more memories out in Minoh 🍻',
          time: 1598027484,
