          rating: 5,
          relative_time_description: '3 months ago',
          text: "Speaking of pure rice sake\n\n[Premium Selection: Shirayuki]\n[Setshu Otokoyama]\n\nThis is it.\n\nI drank nearly 500 brands of sake from all over Japan.\n\nIn the genre called pure rice sake\n\nThese two are a mess.\n\nOf course, I have my tastes when it comes to taste.\n\nWhat is the basis for judging the taste?\n\nKonishi's white snow and Otokoyama\n\nFragrance, umami, body, sharpness\n\nThis is sake (refined sake) and sake that impresses\n\nis.\n\n2022 postscript\n\nIce temperature aging series\n\nPure rice raw sake\nJunmai Ginjo Nama Genshu\n\ninsanely delicious",
