          text: 'Stopped into Kuunohanare (spelling? ローマ字わからへん) after work. Owner/bartender is really nice and seems to be pretty knowledgeable about craft beer. 4 craft beers on tap at any given time, they do rotate them out when reserves are depleted. Also a good selection of bottled craft beer.\n\nOnly negative is that they stop food at 9pm... unfortunately I finish work at 9:15pm so I can never stop by for food after work :(\nBecause of that I have no idea how the food is 😔\n\nThey close completely at 11pm but last drink order (even bottle) is 10pm.\n\nOther than that good place 👍👍',
