          text: 'I visited for the second time. At first I intended to drink standing, but I got tired and moved to the table 😅 The appetizer platter was 1500 yen and it was delicious. Salad is free to refill! It seems that it is a sister store of the izakaya "Sora", so I was convinced by the name Kuunohanare! Cospa is good and I want to go again!',
