          relative_time_description: '6 months ago',
          text: "Beer is delicious!\nHowever, the food serving time is bad !!\n\nA restaurant with such a long serving time\nI have visited every restaurant for over 40 years\nbe born\nfirst time.\n\nThe long record of serving time is\nIt's like Shohei Ohtani's dual wield.\nOne and only.\n\nEvaluation is beer delicious 5\nFood serving time, bad 1\nThe average is 3.",
