          rating: 4,
          relative_time_description: '2 years ago',
          text: 'A craft beer bar with delicious food.\n\nIn particular, beer fried chicken and potato salad are recommended.\nThe selection of draft beer on tap changes from time to time, so you can enjoy it no matter how many times you visit!\n\nThe master was a friendly person, and it seemed that there were many regulars who came to drink alone.\n\nOn Instagram, it seems that the opening status of barrel draft beer is also being sent ☺︎',
