          relative_time_description: 'a month ago',
          text: "I've been wondering about it for a long time, but I had some business at the general art center, so I stopped by. It's a small bar with only counter seats, but the staff are easy to talk to and it's a comfortable place. There are many types of draft beer that you have never seen before, and you can easily enjoy it from half size. I didn't order cheese, which is the shop's selling point, so the type of food may be limited except for cheese. The toilets are western style, but there is a note that men should also \"sit down\", so let's cooperate with men!",
