          rating: 5,
          relative_time_description: '2 years ago',
          text: 'Absolutely love this venue and I expect great things from them once they’re approved to brew on premises.\n\nAt the time I visited they were hosting a tap takeover from Oni Densetsu, a brewery based in Hokkaido. All of the beers were delicious. Ryohei and Shoko are wonderful hosts and I truly enjoyed talking with them about our shared passion for everything craft beer (especially everything Lambic 🤤). The food, though I only ate one item, was also great! I think the options pair very well with beer.\n\nLooking forward to revisiting and seeing some of their own creations on tap!\n\nありがとうございます！',
          time: 1601707666,
