          rating: 5,
          relative_time_description: '10 months ago',
          text: 'When I went up the stairs while being thrilled by the crazy appearance, there was a wonderful space where the story was lively even if it was nice to meet you in an undecorated atmosphere.\nThere are four basic types of beer. There are some interesting seasons while always putting things that are easy to drink. You can choose the size from M and L.\nIt seems that the menu of Otsumami changes from time to time, and the three-kind set was the best as an attestation.',
