          rating: 5,
          relative_time_description: 'a month ago',
          text: "A small shop. I went up to the second floor and got two kinds of original beer. Refreshing and easy to drink. Friendly staff. A shop with an atmosphere that makes you want to go for a drink on your way home if you're in the neighborhood.",
          time: 1669468403,
