          rating: 5,
          relative_time_description: '3 months ago',
          text: "Revisited several times, the best, impressed.\n\nThis is my second time using it! It seems that it has changed to a beer made by yourself from February 2021.02!\n\nLocal beer from Ibaraki city,,, somehow I'm happy",
