          rating: 4,
          relative_time_description: '3 years ago',
          text: 'A precious craft beer store outside Osaka city\n(Location) Stay quietly in the basement of the building across the pedestrian crossing from Hankyu Ibarakishi Station. The surroundings are full of snacks and karaoke shops and the night atmosphere, so it may be a place where it seems a little difficult for women and women to enter\n(Inside the shop) The counter is only 8 seats, it is not wide, but it is clean and calm.\n(Menu) There are about 4 types of barrels mainly in the country, especially the beer of Kuninocho, a local sake maker. There are many overseas bottles. The feature here is that there is a rich lineup of sake. The food system is mainly snacks.',
