          rating: 5,
          relative_time_description: '9 years ago',
          text: 'Originally a record store, the store now offers carefully selected draft beer from barrels of Japanese craft beer.\nThe food includes an assortment of smoked dishes.\nNot only beer but also coffee is actually delicious.',
