          rating: 4,
          relative_time_description: 'a year ago',
          text: 'A simple and small craft beer pub at a crossroads near the Esaka park. Their main drinks are the craft beers which you can have at glass US pint and UK pint sizes. They also have beers in cans and bottles if you don’t want the choices in the draft beers. I wish they’d have all their craft beer available so I could compare them. Unluckily too that I was full at that time so I didn’t eat but I’ll try going at it again for their food.',
