          rating: 5,
          relative_time_description: '3 years ago',
          text: "A shop that stopped by.\nAs expected, without information, we are creating an aura of regular customers who seem to be difficult to enter w\n\nI was a little worried, so in the Google Maps review, the store clerk got information that he likes cats, and assault lol\n\nThe shop has a very calm atmosphere, and there is a regular at the counter.\nIt's a common atmosphere\n\nThat day? For that month? There were about 3 types of recommended craft beer.\n\nWhen I was worried about which one to order, I was relieved that the store manager gave me a very careful explanation.\n\nI received 2 kinds of beer in total, both of which were delicious 🍺✨\n\nI want to go again 😋",
