          rating: 5,
          relative_time_description: '3 years ago',
          text: 'A shop I found while taking a stroll in the evening at Esaka Tomari. Of course, three drafts of Craft Beer were my favorite, with Heartland being able to feel malt and hops tightly. It was delicious.\nHeartland: ¥ 400 / Glass (heartland glass, about UKpint)\nGuest beer: ¥ 1000- / UKpint (It seems to be slightly affected by the beer)',
