          rating: 4,
          relative_time_description: 'a year ago',
          text: "A craft beer specialty store located in Sakaihigashi.\nSpice curry is served for lunch.\nThe curry on this day was chicken curry.\nThe sourness of tomatoes and the mellow feeling of coconut milk are firm and fluffy with spices.\nThe rice contains red beans and chickpeas, and it goes very well with them.\nThe beans are delicious because they are entwined with the curry.\nHowever, the real essence of this shop starts here.\nYou can take out beer!\nIf you select a type from the list of bealls that can be taken out and order it from the store, the server will put it in a special can and it will be canned from there.\nI can't drink beer outside of this era, but there is a service that I can do because I have a liquor sales license like this.\nThe clerk is also a real beer professional and will teach you carefully, so you can choose products with confidence.\nI would like you to come here when you can drink and enjoy beer thoroughly.",
