          rating: 5,
          relative_time_description: '3 years ago',
          text: 'Very friendly staff and the food was delicious. We were the only English speaking customers in the restaurant and both the staff and other customers were friendly and willing to communicate with us. Tons of laughs, beer selection was great for Japan, and the owner took suggestions for additional beers. Definitely recommend for a good local vibe.',
