          rating: 5,
          relative_time_description: '4 months ago',
          text: "It's close to my company, so I often stop by on my way home from work. It's a dream shop in Nara where you can drink craft beer from all over the country on tap, which changes regularly. The master loves beer so much that if you ask him about it, he will tell you all sorts of things, from the taste to the characteristics of brewed sake. The food is delicious and I like the 10 kinds of snacks.",
