          rating: 4,
          relative_time_description: '3 years ago',
          text: "You can watch soccer matches. You can talk about soccer with the master while having various kinds of beer. If you like soccer, this is the place to go!\n\nAll the dishes are accompanied by alcohol. The menu itself isn't that many, but of course it's delicious! The 3-kind meat platter is a great value, juicy and recommended.",
