          rating: 5,
          relative_time_description: 'a month ago',
          text: 'Suitable for 12 yo and below.\nGood number of rides at ¥400-800.\nLife size Slyvavian families.\nFun Grass surfing\n45 mins from city area with a rented car of total cost ¥9000',
