          text: 'Here is local craft beer shop. I ordered two cup of beers. Left side is IPS beer and right side is the GOLD beer.\n\nTwo were different flavor, taste were good both.\n\nThere is little to choose between the two. I rather the IPS beer because strong flavor than right one.\n\nUpstair is open space only foods are allowed from outside.\n\nThe shop with good vibes.',
