          relative_time_description: 'a month ago',
          text: 'Located a relatively quiet but industrial area, this bar has not only brewing tanks but also two-story tap seats. CBs are Gold, Copper, IPA and Thruster, which bottles sold widely across the region. Personally not so amazing taste but reasonably priced at 400jpy for 1/2 pint and 800jpy for a pint. Five light snacks are available. No hidden charge. Only indoor seatings. Transportation is a little bit challenging.',
