          rating: 4,
          relative_time_description: '8 months ago',
          text: "I drank at a shop in Shirahama Onsen town and visited here the next day.\nWe were in a car so we didn't try it, but it seems that you can drink it on the spot.\nI bought this as a gift for a beer-loving friend. The package is also fashionable and about 1000 yen for 2 bottles (^o^)\nThe atmosphere of the staff was also nice!",
