      reviews: [
        {
          author_name: 'Chackie Jan',
          author_url: 'https://www.google.com/maps/contrib/104765112007696219855/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCnLxStHPj0v8ekuVtbXongzQT2gBUeaDUnDx1UQ=s128-c0x00000000-cc-rp-mo-ba5',
          rating: 4,
          relative_time_description: '4 years ago',
          text: 'The food and service are quite good.  The dinner prices are expensive though.',
          time: 1519918618,
        },
        {
          author_name: 'k a',
          author_url: 'https://www.google.com/maps/contrib/113228245180771592445/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCnymVjp17DX25F-6YHJ88s6ut_qgnGzC9cegjo-=s128-c0x00000000-cc-rp-mo',
          rating: 5,
          relative_time_description: '7 months ago',
          text: 'Visited after 11:00 on weekdays.\nAs soon as it opens, there are already several groups of customers. When I left the store, it was full except for the counter, so it might be better to make a reservation for lunch or immediately after opening.\nOrdered the daily lunch (hamburger tomato and cheese gratin style with fried scallop tartar sauce) ¥1080 + dessert set (creme brulee) ¥100 and fluffy egg omelet rice lunch ¥1080.\nI felt that the tomato sauce on the hamburger steak was a little sour, but the cheese made it mellow and it was delicious. The fried scallops and the tartar sauce were both delicious.\nIt seems that the omelet rice and hayashi sauce were excellent, and the eggs were literally fluffy and delicious. If you like hayashi sauce, please try it.\nThe creme brulee dessert set is also delicious for ¥100.\nBoth lunches come with a drink and a salad and are a great deal.\nThe surrounding environment is also quiet and you will stay longer if you are on the sofa seat.\n\nAbout 15 cars can be parked in the parking lot in front of the store.\nPayment is cash only.',
          time: 1654497908,
        },
        {
          author_name: 'nai nai',
          author_url: 'https://www.google.com/maps/contrib/115031606518150798962/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCk-gj0pAGvIsGRKV0Zs32QEiXOnfCLrZhUzIQQp=s128-c0x00000000-cc-rp-mo',
          rating: 4,
          relative_time_description: '4 months ago',
          text: "When I went there around 11:30, there were about 3 groups, but soon it was full and the rest of the people were waiting in the car. It was a Sunday, but the staff seemed to be very busy with 3 people, and it felt like there was no time to lower the plate. The daily lunch was voluminous and very delicious! The daily pasta also had a large volume with bread and salad. Today's dessert for +100 yen was creme brulee!",
          time: 1662292875,
        },
        {
          author_name: 'Yoshihiro',
          author_url: 'https://www.google.com/maps/contrib/108225613392707068993/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a/AEdFTp6PCqhs14aLF-Oc0_jMZJ8GpAKtCQBnfQMLZgnD=s128-c0x00000000-cc-rp-mo-ba6',
          rating: 5,
          relative_time_description: 'a week ago',
          text: "We had the daily lunch. Arrived before 1100 and entered the store at the same time as opening. While waiting for the food to be served, all the seats are full before you know it. I'm hungry with vegetable salad and potato fries...\nI did my best and received the main fried wrap and meuniere. It took some time to serve, but it was a polite job and everything was delicious. The daily lunch menu for a month is decided in advance, and you can see the chef's high level of passion and competence for cooking.",
          time: 1671857825,
        },
        {
          author_name: 'a 141',
          author_url: 'https://www.google.com/maps/contrib/109192915855141343757/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCmF0UNf65bq4LYJPMspMf6PbxDyWapT91LDbek1Rsk=s128-c0x00000000-cc-rp-mo-ba5',
          rating: 4,
          relative_time_description: '7 months ago',
          text: "I've been here several times for lunch over the past 4 years. There may be a waiting list on Saturdays and Sundays. It's a pity that you can't make a reservation by phone and that you have to stand around the entrance slope and wait because it's not a system to write your name and wait. Lunch is a standard menu, but it is quite full and satisfying. Payment is cash only, I would appreciate it if you could use electronic payment etc.",
          time: 1653880930,
        },
      ],
