          rating: 4,
          relative_time_description: 'a month ago',
          text: "A bar with brewing tanks renovated from a former kindergarten. Five own and one guest CB from Toyohashi are on the list. CBs aren't super amazing but not bad. Most guests and staff are young. No transportation from two-mile away train station. Located in a quite rural area, mainly orange fields, some might notice natural fertilizer odor. Indoor and outdoor tables are comfortable for group chats.",
