          rating: 5,
          relative_time_description: '8 months ago',
          text: 'Such a cool brewery in a stunning location surrounded by mikan fields and mountains. We were lucky to get a brewery tour and enjoyed sitting outside drinkint craft beer. The brewery is in an old school that has been remodeled for local businesses! Highly recommend to stop here when you‘re in the area!',
          time: 1650978363,
