          rating: 2,
          relative_time_description: 'a month ago',
          text: "Seven own and several guest CBs are available. Big brand beers are also on the menu and only few of their own bottled CBs are, strangely, on tap... CBs aren't so special except additional local citron ingredients.  Maybe their basic idea is sweetened-cocktailed beer. Staff were all male and their working culture seems military-style macho. A mandatory appetizer of jpy 310. Proximity to Castle. Poor fish & chips, which are just snack...",
