          text: 'Stunning selection in craft beer. I mostly stick to the Japanese selection but they also have a healthy walk-in FULL of imports. Prices are the best in town. Staff are SUPER friendly and passionate about their business of beer. The mother even let me drink a beer in house on one of their take away only days. What a legend. If it’s takeaways you want then this is the best place in town.',
