          relative_time_description: '3 years ago',
          text: 'We were recommended to visit this place by some friends from home. The shop appears to be run by a younger guy and his mom. They have a very impressive selection and very reasonable pricing. I found beers from all over the world, many of which I immediately recognized. If you love beer, this is the place for you.',
