          text: 'Bottle shop is far from central of Osaka but worth for visiting (walk from subway around 1 km.) . They have secret freeze room at back of shop need to ask for access it. Selection is great and price is affordable ( no charge if you want to drink at shop) some snacks provided (not free). Thank you for owner (old woman) even we can not communicate in English but she try to understand me, appreciate that.',
