          rating: 5,
          relative_time_description: '3 years ago',
          text: "We had a daily lunch (800 yen) at Cafe & Restaurant Ravitaillement.\nDelicious!\n\n◼️Shirasu omelette-style vegetable sauce\nA savory omelet with maiko and paprika.\nThe flavor of vegetables and the flavor of shirasu are intricately intertwined and it is a fun taste!\nStill, it ’s delicious.\n\n◼️Miso of thigh fried chicken\nIt ’s crazy outside! It ’s a deep-fried royal road.\nNo doubt\n\n◼️ Chinese cabbage and tuna soaked in plum\nA refreshing chopstick rest with a pleasant taste of sour plum and tuna.\nExcellent compatibility with fried chicken!\n\n◼️ Sliced ​​ham cheese rolls\nCheese, ham and black pepper.\nCan't fit (laughs)\nThis is also a chopstick rest ♪\n\n◼️ Sprout soup with bean sprouts and pork\nA pork soup with a refreshing ginger and sesame flavor.\n\nThe number of items is very large and the taste is very delicious.\nThis is the best price for 800 yen!\nIt is a repeat confirmed shop (* ´ω` *)\n\nAs of August 2019, it has been open for one and a half years. It's been half a year after renewal.\nIt is said that it is used as a company food by a visiting care shop.\nAlso, there seems to be a beer factory in-house, so you can drink your own beer. (I can't taste it because I can hardly drink liquor)\nIt seems that they also provide employment support at stores. This is inevitable cheering ♪",
