      reviews: [
        {
          author_name: 'Taube Gensler',
          author_url: 'https://www.google.com/maps/contrib/102084833173153831530/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCkwb0IbA0TPZiuHUcxyR-wxeMLXXXh6UjbVXRe-mQ=s128-c0x00000000-cc-rp-mo-ba2',
          rating: 5,
          relative_time_description: '7 months ago',
          text: 'One of my favorite places for craft beer and food in Osaka.  Plus, it’s a well-ventilated, open-air, cafe style place on an old funky shopping street with lots of character. The owners are super friendly.',
          time: 1653797223,
        },
        {
          author_name: 'Elliot Bailey',
          author_url: 'https://www.google.com/maps/contrib/108005770971220860888/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCm6IGCJP_k6xwdyA_4QwoGK02gXVzV9pb6-qBL4pA=s128-c0x00000000-cc-rp-mo',
          rating: 5,
          relative_time_description: '2 months ago',
          text: "Amazing draft craft beer options and some of the best Detroit style pizza I've ever had! Staff were friendly from the get go and there was a great atmosphere that night. Will definitely be coming back for the deep dish pizzas!!!",
          time: 1667611149,
        },
        {
          author_name: 'A. Pups',
          author_url: 'https://www.google.com/maps/contrib/117013697433368450943/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCkUIu0zdJvXB7LtXctTcdR_pcUmL6YBRL3xCy1G=s128-c0x00000000-cc-rp-mo-ba4',
          rating: 2,
          relative_time_description: '3 months ago',
          text: 'I really wanted to like this place, but unfortunately didnt live up to expectations...\nPizza looked great, but flavor was lacking... sauce could be more flavorful... some toppings were not available.\nCouldnt order any burgers that day because they only do it on certain days? Wierd concept.\nNo real drink options for those who dont drink beer... i understand its a craft beer joint, but if we bring guest who dont drink beer, or if they dont want to spend 1000¥ on a small craft beer, then their options are very limited...\nThe lemon sour was just too sweet.\nOwner was cooking something that was burning everyones eyes in the dining area... maybe save that for after customers leave...\n\nIt was just a very less then average experience. The inside was nicely done and they have video games available. Owners are nice. Just a few issues maybe need to be ironed out for it to become a great spot',
          time: 1664756028,
        },
        {
          author_name: 'Eric Hinkle',
          author_url: 'https://www.google.com/maps/contrib/110062733003113737265/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a/AEdFTp7RUMs8WRzVgRaox7MboY1OXvlB9QPg8Cobo8mR=s128-c0x00000000-cc-rp-mo',
          rating: 5,
          relative_time_description: '7 months ago',
          text: 'Truly the best. Great beer, amazing food, friendly place where you can always meet people, and the nicest owners. Often their kids are in there too, as well as other children. Kid-friendly, dog-friendly. Mostly American craft beer but also high quality Japanese craft beer. A must when in Osaka! Be sure to go for Bingo night.',
          time: 1653814544,
        },
        {
          author_name: 'Tina S',
          author_url: 'https://www.google.com/maps/contrib/105458051108996969829/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCnhZuK9WBmZW65zGL29tL_8KetP0mPN9SlTQUAYEA=s128-c0x00000000-cc-rp-mo-ba4',
          rating: 5,
          relative_time_description: '3 months ago',
          text: "LOVE. THIS. PLACE. Great beer, absolutely not notch food & excellent service. We had a burger and it was one of the best I've had in Japan. The veggie burger was one of the best I've had ever. The beer selection is awesome--stouts, sours, IPAs... there's something for everyone! Will absolutely come back the next time I'm in Osaka!",
          time: 1662713543,
        },
      ],
      serves_beer: true,
