          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WClqU2VoVixF4ZD7vuKZRt02gvmVybD0ukdPmPC4iw=s128-c0x00000000-cc-rp-mo-ba3',
          rating: 5,
          relative_time_description: '3 years ago',
          text: 'We enjoyed a beautiful dinner at Bar Stand tonight. We both ordered the chicken and firefly squid curry (900Y a plate) - which was delicious and enjoyed a beer and a ume-yu (a sweet ginger drink native to the Kansai area). It was a clear night so we sat out under the stars and used the blankets they provide. The owner is joyous, speaks a little English and made us feel very welcome. The bar is housed in an old style Osakan home and is currently open in the evening until 11pm. Highly recommend a visit!',
