          rating: 5,
          relative_time_description: '6 months ago',
          text: "BAR where I often went to enjoy beer from all over the world. It seems that the business format will be changed from BAR to restaurant at the end of Obon. Mr. Date talked to me lonely.\nCompared to the taste in the photo, the beers are Asahi's Pilsner, black, and peel ale from the left.\nI'm definitely a peel ale sect. You can enjoy the difference in taste by drinking and comparing.\nPlease go to see Mr. Date before the format changes.",
