          rating: 4,
          relative_time_description: '3 years ago',
          text: "I used it at a girls' association.\n\nDumplings are delicious anyway! ! !\nNicholson dumplings are Utsunomiya dumplings, so they are large and very juicy.\nThere is also a variety of gyoza dumplings, such as perilla gyoza, kimchi gyoza, and boiled gyoza.\n\nThere are plenty of drinks, and the mini mug is just the right size.",
