          rating: 4,
          relative_time_description: '5 years ago',
          text: "A beer bar that sells craft beer and Utsunomiya dumplings, but is also open for lunch\nNicholson gyoza dumplings, soup, side dish, salad, rice, and pickles for 750 yen.\nThe voluminous dumplings were good, and I was able to have authentic dumplings with gravy for the first time in a long time.\n*Maybe it's a popular restaurant, so it may take some time for the food to be served as it tends to be crowded.",
          time: 1502838676,
