          text: 'A beer restaurant selling gyoza and craft beer.\nI entered for the first time, but as expected, both gyoza and sake were good.\nBut this one seems to be closed on December 28.\nThere was an image that was always popular ...?\nI think craft beer is really delicious.\nIf you eat and drink normally, it will reach you in no time.\nIn fact, people around here drink beer from the manufacturer.\nThere is also.',
