          rating: 5,
          relative_time_description: '3 years ago',
          text: 'Came here for some pre dinner drinks on a standard Monday evening at 6pm. We were the only people there.\nSmall bar and brewery with 7 of there own brews and a few guest beers.\nWe had 3 of their beers and each unique in flavor, my favorite being the goat juice which was decent ipa.\nEach beer has a great designed label with a cool story to match what they made.\nService was great and no cover charge so coming for a quick craft after work is easy.\nSmall wine glass was 450 yen and large glass at 780 to 880 yen.\nDefinitely worth coming.',
