          rating: 5,
          relative_time_description: '3 years ago',
          text: 'Seven tasty craft beers brewed on site, each one is unique in flavor such as lychee or pomegranate. I recommend the Banyan Tree or the Sparkle. A must for anyone wishing to explore the craft beer scene in Osaka.',
