          rating: 5,
          relative_time_description: '3 years ago',
          text: 'Did a quick search of breweries and bars in the area I was staying and ran into this location just a block from where I was staying.  Glad I dropped in.  Being the only foreigner in the place I felt welcome and the owner was friendly.  They had a good selection of beers brewed on premise.  The Quad Stout was great and the other brews I tried all had their merits.  If you are in the area it is worth a visit.',
