          rating: 5,
          relative_time_description: '3 years ago',
          text: 'Great atmosphere with views, staff have intuitive customer service skills. I asked to put the rugby on the tv but they could only do so via the laptop. Staff tried for a few minutes to connect the laptop to the tv but struggled. With 5-10 minutes until half time they suggested I watch on the laptop. Reasonably happy with the solution, but what I didn’t realise at the time was that the moment half time came, they returned to connecting it to the tv ready for us to watch the full second half on the tv. Intuitive customer service skills.\n\nGood selection of craft beer too.',
