          rating: 4,
          relative_time_description: '4 years ago',
          text: "Visited without a reservation in the morning of August 2018. Selected by friends in Nara. After lunch at Kitahama Bistro Ciel Blue. While many start at 3:05 pm, this place is open from 11:00 am until night. Precious. A wonderful view from the 8th floor of a building along the Naniwabashi Okawa River. Photo competition before ordering. You can also see Nakanoshima Public Hall. Finally considering the order. Recently, I found out that there is actually a brewery in the town, and if I thought I had to go, I found the sweet porter of the beer Naramachi brewery. Order now. My friend is this store's original Kölsch. In addition, we drank a lot the day before at Beer Berry Tenma, but we both enjoyed craft beer such as Minoh's Peach Weizen and Niigata Swan Lake European Pilsner Koshihikari preparation. It was also fun to talk about craft beer with the staff. A friend in Nara introduced me to another recommended craft beer shop that is easy for women to enter alone. I understand why you introduce me because I know the background of this shop. This shop is a group company of Ichinose Co., Ltd., which also manufactures tanks for microbreweries. This is because we hope that craft beer brewing and the craft beer industry as a whole will thrive in order to show craft beer manufacturers what kind of beer they can make using our equipment. It is said that it is also delivered to Mr. Isekado. amazing! Next time, I definitely want to enjoy watching the night view. I stayed there for over 3 hours. Thank you very much!",
