          rating: 4,
          relative_time_description: '3 years ago',
          text: "A beer pub with a brewery in Kitahama.\nI've been interested in it for a long time, so I visited. On this day, in addition to the Kölsch made here, we had guest beer WHITE WIND (Nara Brewery) and Swan Lake Beer Weizen. We have a very high quality local beer. The food is mediocre and nothing special. However, since this shop is on the 8th floor of the building, the night view was beautiful and the atmosphere was very good. Next time I would like to visit the day when there is another beer.",
