          rating: 5,
          relative_time_description: 'a year ago',
          text: 'Tap room with many types of IPA. There are many types of food, and there are also alcoholic beverages other than beer, so I felt that it was a perfect place to invite craft beer beginners to this world.\n\nIt seems that the connection with Minoh beer is deep, and it seems that they will make Hazy for the first time as Minoh beer by crowdfunding, and it will be offered at the shop, so it is the biggest event this spring for craft beer lovers. There is no doubt that it will be.\n\nContrary to the traditional atmosphere of an Irish pub, I also appreciate the fact that it is the current tap room style.\n\nIt can be said that this is a shop where you want to take your friends and enjoy a delicious beer slowly.',
