          rating: 5,
          relative_time_description: '6 years ago',
          text: "I loved this craft beer pub! Who gets the idea to rebuild a garage into a rough, industry design and beautifull pub? They kept the garage door, but with Windows in it. The bar it self is could with a black board on one wall with all the different craft beers offers for the day on the 15 different taps. The bar keeps where really nice and helpful. There were no menus in English, but the bar keep was rather good at English so works out fine. We only tried out the beer so I don't know how the food is, but the plays coming out of the kitchen looked very nice. The only negative was that smoking was allowed in the whole restaurant. If you like craft beer this restaurant is a must. I would say it so good that it's worth a detour if you are in Osaka!",
