          relative_time_description: '6 years ago',
          text: "Good beer - a pint will run you 1000 yen, which is a little expensive, but it's for craft beer, so it's acceptable. What surprised me were the wings, which I really liked and the buffalo sauce rocking.\n\nIt gets hot in here to an extent that's unpleasant, because they have one big fan and lights for a theater so they get super hot. Other than that, it's great",
