          rating: 5,
          relative_time_description: '3 months ago',
          text: 'Very cool-looking craft beer store. The owner himself also looks very cool. There are many specialty beer varieties with reasonable price. I like the Pilsner and their moonlight (or moonshine?) honey beer. The fried corn was delicious! Crispy, sweet and go very well with curry powder. Recommend!',
