          rating: 4,
          relative_time_description: 'a year ago',
          text: 'Four seasonal CBs brewed there are available. Space is limited but you can watch the brewing facilities. If u wanna enjoy CBs over chats, its Taisho riverside location suits that, with more CB choices.',
