          rating: 5,
          relative_time_description: '5 years ago',
          text: "Great beer brewed onsite in a contemporary and clean environment.  Their saisons in particular are absolutely delicious.  This seems like a locals spot, but the bartender was super accommodating and knew enough English to meet me halfway.  I'd recommend this place to anyone looking for a cool brewpub in Osaka",
