          rating: 4,
          relative_time_description: '3 years ago',
          text: 'I found this place is comfortable. There were so many local Jap. customers enjoying talking with the beertenders. There were only taps, no bottles. Craft beer here is a bit expensive compared to another place, but this may be standard price here i’m not sure. I found the food here well defined in details.',
