          rating: 5,
          relative_time_description: '3 years ago',
          text: 'Definitely the best beer bar in Osaka.\nThey serve several kinds of beer, some are from overseas and some are made in Japan.\nAll the food is as well as amazing, but the owner is the reason why I have kept going back to this place.\nHe is the best!',
