          rating: 5,
          relative_time_description: '4 years ago',
          text: "Fantastic set of food for 980 yen! Interesting beer collection. A lot of cloudy beers these days, which suits me fine. The idiots who claim this place is not foreigner friendly make me laugh. Yes, there is a cover charge which everyone, Japanese and foreigner alike, pay without complaining! Do these people think they should be exempt from this?\n\nI give this place my highest recommendation. It's on par with Kamikaze.",
