          rating: 5,
          relative_time_description: '4 years ago',
          text: 'Super good and modern craft beer bar, friendly staff that really knows about beer. Serves some food as well. Osaka is great for bar hopping, and specially if your into craft beer, Osaka and Gulp is a must go. The staff speaks english and has a good collection of both japanese but also beers from US, Europe and much more.',
