          rating: 5,
          relative_time_description: 'a year ago',
          text: 'I will definitely visit or order to this wonderful cafe again. Today I ordered vegan beans burger and Gorgonzola shimeji & honey. As a vegun or vegetarian person, it was so nice to know this cafe.\n\nThanks for Uber for let me know LiNGUA World Cafe is my neighborhood :-)\n\nDid you find that they put some Christmas decorations to package? l love those.',
