          rating: 5,
          relative_time_description: '3 months ago',
          text: 'I wasn’t able to go back to Canada this summer. Lingua helped soothe that pain by giving my a taste of what I missed in the Great White North. Particularly, the poutine!! Always great fun in a relaxed atmosphere.',
