          text: "This is where you can drink MARCA in Tugboat Taisho.\nThere are multiple shops, and I think it's good to be able to eat and drink freely.\n\nThere are 4 types of beer to compare, and you can choose the type and size. This is the first time I've seen a drink comparison where you can choose the size, but I wanted to drink all types (7 types on the day), so I got the S size.\n\nPersonally, Persian white and coffee amber were delicious ♪\nA beer stand where you can enjoy various beers with a variety of beers♪",
