          rating: 4,
          relative_time_description: '3 years ago',
          text: 'Book a craft beer all-you-can-drink course and visit.\nOrdering is troublesome because the glass is small, but I am satisfied because I can drink various things.\nIs the cooking passable?\nThere is nothing noteworthy.\nThere was no sausage in the course, so I ordered an additional one, but this one was delicious!',
