      reviews: [
        {
          author_name: 'M arie',
          author_url: 'https://www.google.com/maps/contrib/107906536783079062333/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a/AEdFTp6LG3c1dhktaJoDylIFIr6GirugYk-izv4RVeYt7Q=s128-c0x00000000-cc-rp-mo',
          rating: 3,
          relative_time_description: 'a year ago',
          text: "I ordered the spicy ramen with cheese, and it was spicy alright but it was also bland at the same time. Probably the worst miso ramen I've ever had and I've been living in Japan for 3 years. I felt like they didn't put salt in it and I couldn't taste the miso at all. The charshu slices were also bland, I've had better ramen for 300¥. The interior looks good though and their menu itself is made to look like a newspaper which was interesting but I don't recommend the food 🤔 *clean place, staff are accommodating and nice",
          time: 1619574246,
        },
        {
          author_name: 'Felix Travel',
          author_url: 'https://www.google.com/maps/contrib/107448354906492721735/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCkMdbWjNxB4MWnsIwL-ew9BeJOroMzkc6-3JKMg=s128-c0x00000000-cc-rp-mo',
          rating: 5,
          relative_time_description: '2 years ago',
          text: 'Their vegetarian ramens were so good we tried all five broths in one night and they all tasted different and excellent. The winter vegetable side dish with miso dressing was a favorite too. Wish I had the room to try vegan mazesoba as well but oh well next time!',
          time: 1578480504,
        },
        {
          author_name: 'Michelle Cronin',
          author_url: 'https://www.google.com/maps/contrib/109628946155408120449/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WClF98JKZWFXTTgTu6kivtqZ2zWShOm46v4exJdkO00=s128-c0x00000000-cc-rp-mo-ba6',
          rating: 5,
          relative_time_description: '3 years ago',
          text: 'I loved this place, there were 5 vegan ramen dishes to choose from. I went for the spicy one with a Weissbier. The staff were very friendly and had good English. The menu is in both in English and Japanese. The ramen was delicious and just the right spicy, a small kick and full of flavour. I sat up at the bar and felt very comfortable having dinner on my own. Highly recommend, especially for vegetarians.',
          time: 1572782966,
        },
        {
          author_name: 'Thomas Finch',
          author_url: 'https://www.google.com/maps/contrib/110102783699908715373/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCkcvZ8wdOg8tghI1ptE2MLvAkIPpvFJrJgpLpgIZYU=s128-c0x00000000-cc-rp-mo-ba4',
          rating: 5,
          relative_time_description: '3 years ago',
          text: "This 25 seat establishment near the Umeda Sky Building is touted as having the best miso ramen in Osaka, and when you try the Vegetable Bowl Ramen made vegan, it's easy to see why.  The soup is made rich and creamy with miso and soymilk and it's full of delicious fresh ramen and veggies, with emphasis on squash and yam. Runs 900円ー1200円, which isn't bad for the area. The vegan Osaka-style Ramen, which uses soy sauce in the broth along with lots of green onions, a few veggies, what I believe may have been fermented bamboo, and tofu in place of the traditional slice of pork, was also good but doesn't hold a candle to the Vegetable Bowl Ramen.  That would have been worth the trip to Osaka all by itself.\n\nAlthough the English menu lists only six items as vegan or able to be made vegan, the online Japanese menu lists two additional \"Vegan対応\" items.  Next time we will be trying the vegan Spicy Ramen from the Japanese menu.",
          time: 1547250303,
        },
        {
          author_name: 'Lukas Renggli',
          author_url: 'https://www.google.com/maps/contrib/101811405085619797773/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCmfrQYzgAyOIAhflyivUSRhcEHvdZJ0aMR7Q_RdpA=s128-c0x00000000-cc-rp-mo-ba6',
          rating: 5,
          relative_time_description: '3 years ago',
          text: 'Excellent ramen place. While they serve meat and fish, but they have a deticated section with 5 vegan ramen in the menu. We went here twice and were not disappointed! Rich in taste: creamy, spicy, clear, ... It is your choice. Friendly service and great interior where you can watch the cooks prepare your order.',
          time: 1566707292,
        },
      ],
