          rating: 4,
          relative_time_description: '3 years ago',
          text: 'Great selection and most reasonable prices of any craft beer place in Osaka, pints for around only 800 yen! The catch is that unlike other places there is a 300 yen table charge but the snack we got for the 300 yen was pretty delicious. Staff were nice and brought us English menus. I will definitely be back.',
