          rating: 2,
          relative_time_description: '3 years ago',
          text: '5 stars for their excellent beer and reasonable prices, but minus 3 for their horrible service. The tall male host/server is one of the rudest people I’ve met in a long time. So strange for Japan!?! These people would be fired elsewhere but the location is so good so I guess it’s hard to find suitable staff.\n\nTheir restaurants elsewhere (it’s a chain) are a much better experience due to better service.',
