          rating: 4,
          relative_time_description: '4 months ago',
          text: 'There are 4 taps of craft beer, 1 type of cider and a wide variety of whiskey and other liquors.\nThere is only one counter and one table seat, but the space is spacious and you can enjoy a relaxing drink like a hideaway.',
