          rating: 4,
          relative_time_description: '3 years ago',
          text: "A hidden beer bar with 4 taps of craft beer in the back of Nakazaki-cho.\nIt's a small shop with about 10 counter seats and 1 table for 4 people, and there are quite a few bottles of whiskey and craft gin.\nIt seems that you can spend a relaxing time with the friendly owner and the calm atmosphere behind the roji.\nThe difficult point is that the entrance is difficult to see from the front, but thanks to that, you should be able to spend a quiet time.",
