      reservable: true,
      reviews: [
        {
          author_name: 'Ryan Mui',
          author_url: 'https://www.google.com/maps/contrib/107723322316168638972/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCmoRs95fbq55Cch8txsy8xBvTS9NG1lTFSpKVKQswg=s128-c0x00000000-cc-rp-mo-ba5',
          rating: 5,
          relative_time_description: 'a month ago',
          text: "Very laid back atmosphere. I can see why everyone raves about this place. The food and drinks are great and the owner and staff run the place quite well.\nI ordered a few beers that were described in great detail on their online menu and they did not disappoint.  The double hamburger was just the right size, not too overbearing to bite into and the balance of meat to veggie to bun was just right.  I'd love to come back soon.  Thanks for the wonderful experience.",
          time: 1668866257,
        },
        {
          author_name: 'Kamille Mercado',
          author_url: 'https://www.google.com/maps/contrib/110976300433425940239/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCkIYAntn5rps4upbB88QbL0lXBzoGgpFOIHHW6QEA=s128-c0x00000000-cc-rp-mo-ba3',
          rating: 5,
          relative_time_description: '7 months ago',
          text: 'I came here alone and was feeling a bit anxious, but I easily felt comfortable once I stepped into the restaurant seeing how chill the vibe was. The owner, Mike, was attentive and welcoming. I came for Taco Monday and was pleased with my entire meal. The variety offered on the menu was great, you can mix and match your meat, toppings, and type of tortilla. The tortillas were homemade and wonderful, I ordered the blue corn tortillas for all my tacos for maximum flavor and presentation. I was able to sample all of the meat options they had, each one had their own unique flavor profile, was seasoned well, and tender. On top of that, they made their own hot sauces. When Mike pointed that out to me, that basically sealed the deal and made this place my new favorite place to eat! I’m in love with the reaper honey hot sauce and cherry chipotle hot sauce, ugh, so good! Not only were the tacos all you can eat, but so were the fries. They do not mess around here and really load up their tacos and fries with all the goodies. I just could not find any fault in the place and I’m already planning my next visit there.\n\nPictures:\nTacos left to right\n\nBeef: Taco Truck style, Pork: BBQ Style, Beans: Tex-Mex Style\n\nThen I had the chicken tex-mex style for my fries.\n\nThe free drink I selected was tequila sunrise, which was flavorful, has just the right kick from the alcohol but tasted smooth (I mean they just don’t miss!)',
          time: 1652960939,
        },
        {
          author_name: 'J Durant',
          author_url: 'https://www.google.com/maps/contrib/112634652108065066023/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a/AEdFTp5dpZo42idjzon1a90L4u9hh_GN_2jOwGHvIVoz=s128-c0x00000000-cc-rp-mo-ba5',
          rating: 5,
          relative_time_description: '8 months ago',
          text: "First, it is found on the third floor. It was a really fun environment to take a date or some friends to. I really enjoyed the hot sauces. They were hands down the best part of the whole experience. They, at the time of writing this, have a monday all you can eat taco and fries deal. It is pretty impressive. For someone that hasn't had good Mexican/tex mex food in over 7 years, I enjoyed this.\n\nThey have a lot of beers and make some mixed drinks. They also make a rootbeer float, and that was a fun trip down memory lane.",
          time: 1651563427,
        },
        {
          author_name: 'Aeric Wong',
          author_url: 'https://www.google.com/maps/contrib/115606939915291310799/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCkCFdgP1_9RkINoqq9DUyigDvIlXaeKVrsQwQJlmEc=s128-c0x00000000-cc-rp-mo-ba4',
          rating: 5,
          relative_time_description: '3 months ago',
          text: "Tremendously good burgers and tacos!\nMy group had the New Caderona and Alpine burgers, followed by some chicken tacos (taco truck-style, corn). So good!\nAnd the hot sauces! Oh, the hot sauces. Each had their own charm but the standouts were the reaper honey and the cherry chipotle.\nFor bevvies, you can go for the standard fare, but they have some hard-to-find stuff, so my group decided to go big. We shared the Hardywood Raspberry Stout and the Lickinghole Creek Carrot Cake Imperial Amber Ale. A little spendy (1,750 ea) but where else can you drink these? Even with these beers, the total bill was still very reasonable. All in all, a new fave spot.\nWe were missing one of our regular group members this round but will be returning next month just to he doesn't miss out. That and I also want to try out the other food options.",
          time: 1663379704,
        },
        {
          author_name: 'Felicity 151',
          author_url: 'https://www.google.com/maps/contrib/104885857741480451929/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCmsWZsNZh7tkAK8r4XNK_gwLYLH4tmHbRx9hMlp=s128-c0x00000000-cc-rp-mo-ba3',
          rating: 5,
          relative_time_description: '10 months ago',
          text: "If you're craving for American food in Osaka, this is the place to go to.\n\nThe owners were nice, and they serve delightful real American burgers 🍔. I had a set of their signature burger with cross-cross fries. It was tasty and the serving size is just right.\n\nThey also have their own spicy sauces, and the cherry sauce with coffee and other spices matched my burger.\n\nWe hope to try their tacos (and other food) next time. 🌮",
          time: 1647139841,
        },
      ],
