          rating: 5,
          relative_time_description: '6 years ago',
          text: 'Great place for beer and pub food. UK pints of Japanese craft beer available for 1,000¥, as well as cask ale versions of Yona Yona, Tokyo Black, and Aooni on draft. Besides this, they apparently have a large bottle selection and rotating Japanese guest beers.\n\nThe onion rings are huge, cheap and amazing.\n\nIf I had to complain about something, it would be the fact that its not non smoking, but thats it. Fantastic place!',
