          rating: 3,
          relative_time_description: '5 years ago',
          text: "I asked for a course, but there were a lot of potatoes with mayo sauce lol. All-you-can-drink is not bad, but it's normal. The main raclette cheese roast chicken was reasonably good, but overall the taste is a normal izakaya menu and the cost performance is not good. Garlic rice, which was just finished, was really delicious.",
