          rating: 1,
          relative_time_description: '4 years ago',
          text: 'Even though I made a reservation for the anniversary course, it took 45 minutes from the first item to the second salad. People who came in later and ordered normally got 3 items and 4 items.\nThis store is so incompetent that it takes 45 minutes to make a salad.\nMoreover, even after that, the course menu was skipped and the menu was brought, and even the main raclette cheese was skipped for dessert.\nIt took me two and a half hours.\nThe dessert was also a message plate in the contents of the reservation, but what was served was a normal assortment.\nWhat kind of management would make two items skip the menu?\nOne of them was the main dish.\nI made a reservation with a specified time, so I was able to prepare in advance.\nA great birthday celebration is ruined.\nAs you can imagine, the reviews on gourmet sites are only from 2 or 3 years ago.\nThe store manager apologized, and it is a mystery whether the store clerk is also reflecting.\nSome comments have a reply from the owner, but nothing has changed since then. How to do it.\nNever again.',
          time: 1525017965,
