          rating: 1,
          relative_time_description: '5 years ago',
          text: 'Minimum. The food is slow to come out. Only two items, pizza and pasta, came out after waiting for an hour and a half. When I asked about the other dishes, they said, "I mistakenly served them to the wrong table." The other shop assistants seemed to be busy chatting in the back and didn\'t apologize.',
