          rating: 5,
          relative_time_description: '9 months ago',
          text: "It's rare to find breweries excel at brewing traditional and modern English/Irish style beer as well as German and Belgian styles in Japan.  Plus, 700 yen/US pint is incredibly low price at the craft beer standard in Japan.",
