          rating: 4,
          relative_time_description: '8 months ago',
          text: "Five to six Mie, domestic and US CBs are available on tap. There're a couple of canned or bottled CBs but their onsite consumption cost double as takeaway. A little bit pricy but no otoshi (mandatory appetizer). Staff is friendly and sanitizer is available on each table.",
