          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCkA0bexGg9NPlo3NFcwgomm07x5Wqc4nVCO86vP=s128-c0x00000000-cc-rp-mo-ba4',
          rating: 5,
          relative_time_description: '3 years ago',
          text: "This is the second baroque bar that I always go to, and it specializes in beer.\n\n9 taps are also connected, so it's the best shop for beer lovers! Isn't it a rare shop where you can enjoy both Japan and overseas?\n\nThere is a line of nitro (nitrogen), but the point is that you can drink it at a reasonable price.\n\nIf you want to drink beer in Yokkaichi, go to HOP CROWD!",
