          rating: 5,
          relative_time_description: '3 years ago',
          text: "One of the nine taps can be switched to Nitro. Old Rasputin was served in nitro when I visited.\nIt seems that Ise Kadoya Beer is always connected to two taps, so fans can't get enough of it. I wonder if there are not many places in the Tokai area where cider is also connected. I think.\nYou will be healed by the owner's lovely smile.",
