          rating: 2,
          relative_time_description: '2 years ago',
          text: 'Disappointing experience. There were about a dozen staff and only 2 tables of customers. After we ordered, it was only about 2 minutes until we were served. Of course one cannot be disappointed by fast service, but getting our doria and pork ribs very quickly was slightly worrying. The food is expensive as well, even though portions were small and the prawn in the doria tasted like it was powdered.',
