          rating: 5,
          relative_time_description: '8 months ago',
          text: "There was a line, but it didn't take as long as I thought to get a seat, probably because the customer rotation was good. Also, the food comes out quickly, so it's helpful when you're hungry. Meat and local beer were delicious. Next time I come to Nabana no Sato, I want to come here.",
