          rating: 5,
          relative_time_description: '4 years ago',
          text: "A shop where you can enjoy craft beer in Kuwana.\nThe atmosphere is stylish and I personally like it. In addition, it is very close to Kuwana Station and has good access, so I think it's a shop that makes you want to stop by.\n\nCraft beer has 6 taps and multiple bottles, so I think it's a place where you can fully enjoy craft beer.",
