          rating: 5,
          relative_time_description: '4 years ago',
          text: "It's a small shop with two counters and table seats, but it's a female owner, but it's comfortable.\nIt's okay for a woman to drink alone 🙆\nEven those who are not good at 🍺 can suggest crafts that are easy to drink 🍺, and there are also fruit-based bottled beers, so I am impressed with the breadth of 🍺. The snacks are simple, but the menu is perfect for beer 🎶\nMy recommendation is Lindemance 🍺\nThe other day, I had a beer made from cassis and chocolate! ️",
