          text: 'Craft beer shop that offer bottles, cans and in plastic cups poured from the tap. The food they offer is sweet mochi so that if you want to get nibbles, go next door who sells fish balls and skewers.\nVery limited seating offered just outside the shop nor it seems possible to walk along with the beer in the cup...be sure to check the seats or you will be standing before you order...four beer sampler is a good deal.',
