          rating: 5,
          relative_time_description: '6 months ago',
          text: 'Located between Ise Gaigu Shrine and a train network hub, facing a tourist street, Gegu-Sando, this stand is owned by Ise Kadoya Brewery. Despite a tiny space and limited seats, the CB choice to-go (by bottle or can) is amazing. A flight set of four CB is limited to Neko-nihiki, Pilsner, Hime White and Pale ale, whereas its Naigu location offers the choice of four out of six CBs. All served in plastic cups so CB lovers can drink away.',
