          relative_time_description: '6 years ago',
          text: 'First of all, Ise Kadoya Brewery makes truly excellent beer. This outlet is basically a mini beer shop that also has 4 varieties on tap for tasting. Not much space to sit down, but the street itself offers a pleasant environment to to wander and sip.',
