      reservable: true,
      reviews: [
        {
          author_name: 'Dazza Harding',
          author_url: 'https://www.google.com/maps/contrib/110328063240981697244/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCl0FjHql8SWKj7PLc8gpcj9_Xczv_44NjCqZW7_=s128-c0x00000000-cc-rp-mo-ba3',
          rating: 4,
          relative_time_description: '3 years ago',
          text: 'For an Irish bar in Uji, it does pretty well. The atmosphere is on point and the food is great. I had the Cheeseburger and couldn’t keep the thing out of my mouth it tasted so good.\n\nA staff member speaks okay enough English if you can’t Japanese and the menu is bi-lingual so there was no issue there.\n\nThe only problem was that the price of the drinks were a little on the high side for Japan, but I’m sure for some of the drinks on the menu, this would be the only place to get them in Uji.',
          time: 1553081661,
        },
        {
          author_name: 'dany s',
          author_url: 'https://www.google.com/maps/contrib/117905456841125804323/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a/AEdFTp43fPcV-Y-OhGH9tmXXCIodGQkRrVRP4dj9fTt0=s128-c0x00000000-cc-rp-mo-ba3',
          rating: 2,
          relative_time_description: '3 years ago',
          text: "Stars for atmosphere only.\nThe decoration was really nice and they played good music, but it was cold, we waited the longest time and got served the most god awful cocoa the world has ever seen.\nBenefit of the doubt, the food might be a lot better, but we wanted to drink something to warm up before ordering and after the twenty minutes it took them to prepare that freak of nature drink we decided to not risk it.\nThe menu doesn't include tax either, but fails to note that anywhere, which would be a nice touch.\nPropably great for food, of they don't forget about you in the mean time.",
          time: 1575195407,
        },
        {
          author_name: 'Georgios Maroudis',
          author_url: 'https://www.google.com/maps/contrib/109174260928686906162/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WClZ24Xy7ecsmxhbJFXiH54oNLettCLM0E9IXkb5eQ=s128-c0x00000000-cc-rp-mo-ba4',
          rating: 4,
          relative_time_description: '3 years ago',
          text: 'Awesome place!\nWhile the prices are not the cheapest, the food is great and the atmosphere is just right for some smooth craft beer.\nI tried one of their burgers and it was big, yummy, and juicy!\nThe meat used is actually local, using Awaji island beef.\nRecommended for sure!',
          time: 1570773657,
        },
        {
          author_name: 'Joao Eduardo Martin',
          author_url: 'https://www.google.com/maps/contrib/107998966563213143972/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCkS2Whqr4ZZ94M_qw7uPHuzAqwUegXu2-qxxaD_u14=s128-c0x00000000-cc-rp-mo-ba3',
          rating: 5,
          relative_time_description: '2 years ago',
          text: 'Nice cozy place with good music and a fair selection of craft beer on draft, but they really shone with their snack options! The "suggestion menu" (おすすめ) was WONDERFUL, with grilled edamames, yakitori, roasted squid and a selection of smoked treats, which included smoked cheese, nuts and a potato salad. Went for some good beers, and was surprised with some GREAT food!',
          time: 1605094959,
        },
        {
          author_name: 'Eric Walker',
          author_url: 'https://www.google.com/maps/contrib/106284994166753510087/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCk7ln1cyYHYkj7lrFgEhyWzBmCBchJe_7tfb5-F=s128-c0x00000000-cc-rp-mo-ba3',
          rating: 1,
          relative_time_description: '2 years ago',
          text: 'Just tried to have lunch. Only 3 other people were inside and 2 had their food already. It was going to take at least 15 minutes just for a burger. Not the end of the world, but had confusion about the prices. The sign outside said 1050 yen. The main menu said 1050 yen. The lunch menu said 1250 yen, same exact thing, no drink included or anything. Asked the waitress and after consulting with her phone for a minute she concluded the cheaper prices are old. Get your business in order. I doubt this place will still be there at the end of the year.',
          time: 1580789658,
        },
      ],
