          rating: 5,
          relative_time_description: '2 years ago',
          text: 'Came for the beer. Excellent video and tour (for free!) with recently added English translations. Was lucky enough to have visited  while they had some extra craft beer taps on, available at ¥100 a taster 🤩 Great service in the bar/restaurant. Will visit again and try the sake.',
