          rating: 5,
          relative_time_description: '3 years ago',
          text: 'So much fun. 🌞\nWow they brew sake and beer 🍶🍺\nGreat sales room up front with all their products for sale.🛍️🛒\nThere is a bar with a lot of beers on tap and great views of their brewery. ⚗️\nThen the restaurant is huge with fun seating and a huge menu. 🏮🥠\nBeers and sake are offered at the restaurant 🧴\nOffers taster sets 🍺🍺🍺\nRestaurant has a great menu 📖🔖\nGood for a meal with friends, coworkers, family, or a quick drink after work. 📉💏👨‍👩‍👦‍👦🗣️\nStaff is super cool and attentive.  🏆\nQuick 8 minute walk from the train.🚈\nParts of the restaurant are shoe free wear nice socks . 🧦👢👟',
