          rating: 3,
          relative_time_description: '3 years ago',
          text: 'Price was very seasonable for the food and quality. Good value for money if you need a break from sake! It is a good lunch option if you are here for half day tour. It gets really popular during lunch time - I’d recommend coming in at noon.',
