          text: 'Located on a back street in a quiet residential Kyoto neighborhood is a wonderful find ~ a top-quality, award-winning brewery open weekends with a rotating 5-tap selection of well-crafted beers. My favorite is a mysteriously-entitled "Mosaic Punch" ~ a stunning, balanced hazy IPA. Save some for me!',
