          rating: 4,
          relative_time_description: 'a year ago',
          text: "Is there a place like this that makes beer? As you walk along the narrow streets in the town, you will find a building that looks like a small warehouse.\nStandard beer? And there was a limited-time beer, and I could choose 5 types on this day. You can also choose the size of the glass from small to large. In particular, the White IPA uses Kyoto hops as they are without being dried into pellets.\nThere are several kinds of snacks, and you can warm them up. I'm sorry to say this is unexpected, but it's good!\nUnfortunately, the bar is only available on Saturdays and Sundays, and not all standard beers are available. It can't be helped...\nIf it's just beer, ★5!",
