          rating: 5,
          relative_time_description: '8 months ago',
          text: 'I visited the tap room on the weekend.\n\nI recommend the hassaku white.\n\nIf you walk west from Imadegawa subway station, you can reach it in about 7 minutes on foot.\n\nThe facilities can be seen from the outside, so you can enjoy beer even more.\n\nThe owner really loves beer.\n\nYou can also order beer from our online store. In addition, it is also subject to Kyoto City hometown tax return gifts.\n\nHassaku White\nJapan Great Beer Awards 2019 (Silver Award)\nJapan Great Beer Awards 2022 (Silver Award)\n\npale ale\nJapan Great Beer Awards 2019 (Bronze Award)\nBeer One Grand Prix 2021 Light Color Ale Category (Silver Award)\nJapan Great Beer Awards 2022 (Bronze Award)\n\nYasuragi IPA\nJapan Great Beer Awards 2019 (Bronze Award)',
