          rating: 5,
          relative_time_description: '3 years ago',
          text: "This is a little out of the way but I'm glad I went. The beer might be the best I've had in Japan. It's up there but I only got to try it once so it's hard to say.\n\nSimple styles done well. That's what I liked most, nothing weird. The brewer knows how to make beer. They are friendly to tourists and I felt very welcome. You can buy bottles here as well.",
