          rating: 5,
          relative_time_description: '4 years ago',
          text: 'Great place to drink and eat!  So many pubs look western in Japan. In this case, Takanoya converted an old Machiya into a pub. Which keeps a since and feeling like you’re still in Japan. They unusually feature 9 or so limited microbrewery beers from around the world. Most of the staff can speak some English. And are very good at suggesting food pairing to enjoy your pint of beer with.\nNot to mention that smoking is not allowed inside the pub.\nCheers!!',
