          rating: 5,
          relative_time_description: '3 years ago',
          text: 'An absolutely awesome place to go for delicious food, delicious beer, and a relaxing environment. The service is absolutely fantastic, as our waiter was extremely happy, and didn’t mind waiting for us to pay our bill. Super friendly! Would absolutely come here again.',
