          rating: 5,
          relative_time_description: '3 years ago',
          text: 'This is a local Japanese pub with amazing hear and burgers. We ordered the double IPA beer along with the monster burger and salad. Everything was amazing but the extraordinary thing was the friendliness and the respects you see from the staff. We paid the bill and were already out of the pub whole the chef followed us to thank us for our visit. You get such standards only in Japan.',
