          rating: 5,
          relative_time_description: '7 years ago',
          text: "Great travelers pub. Good mix of locals and foreigners. Location is right by the subway. Very good selection of local craft beer. Stopped here both nights I was in Kyoto. Didn't try the food but the beer was great. Expensive (1200 yen for a full pint) but a solid place to get a local beer with no worries.",
