          rating: 5,
          relative_time_description: '5 years ago',
          text: 'This is a friendly well-lit place with an excellent Japanese craft beer selection including IPAs, which I prefer. It is very different from the preponderance of Irish pubs in town and was not smoky when I went there twice.  The beers are a tad pricey. Tadg is often there, as is his efficient and friendly wife.',
