          relative_time_description: '7 months ago',
          text: 'I highly recommend Beer Komachi. It is small and may seem intimidating to a foreigner but the staff was very friendly and the menus are in English as well as Japanese. The Beer is great and they take care of their kitchen and beer taps so that the quality is very good. The Karaage is too notch, best I have had anywhere.',
