          relative_time_description: '3 years ago',
          text: 'The restaurant my wife and I kept coming back to. The vibe had a nice balance of locals and travelers which gave it a welcoming/friendly vibe.\nThe beer selection was excellent. They really strive to gather a good selection of local beer.\nThe food was really great too and offered a wide variety of options.',
