          rating: 4,
          relative_time_description: '3 years ago',
          text: 'Tucked away from the main tourist heavy sites, Beer Komachi has a diverse selection of craft beers and a delectable menu of fresh seafood, seasonal vegetable tempura, and sizzling teppanyaki. Would recommend to anyone wanting a moment to catch their breath and enjoy a pint!',
