          rating: 5,
          relative_time_description: '5 years ago',
          text: 'Spent several hours here drinking great Japanese craft beer and eating fantastic plates of food. Simon spoke good english and is a overwhelmingly nice person. He was incredibly knowledgeable about the beer selection and helped me pick out some delicious food from their menu. A very cozy place that a nice place to relax after a day of typical touristy stuff.',
