          rating: 5,
          relative_time_description: '4 years ago',
          text: "Fantastic little bar, craft-ale-meets-izakaya, a must visit for any (craft) beer fanatic visiting Kyoto. Excellent, friendly service and superb bar snacks. We had a platter of smoked meats and cheeses that would put a lot of UK bars to shame. Great range of locally brewed Japanese beers too.\n\nA perfect place to try a sake too, the staff give a generous overpour into a little lacquer box under your glass. When you've finished the glass your pour the rest into your glass and drink it up!! 😋\n\nA little hard to find, but the 'treasure hunt' was definitely worth it.",
