          rating: 5,
          relative_time_description: 'a month ago',
          text: 'One of the best brewery experiences I have ever had! The restaurant could stand alone as an excellent bistro while the craft style beer stood up to some of the best in America and abroad, all at a very reasonable price. Well worth making a reservation and/or going out of your way to find.',
