          rating: 5,
          relative_time_description: '2 months ago',
          text: 'definitely a 10/10! a perfect place with great music, superb food and very friendly staff. I came alone & as a non-Japanese speaker, and I don’t feel uncomfortable at all. Fantastic ambience - cosy and not noisy. Thank you for the hospitality! ❤️',
