          rating: 5,
          relative_time_description: 'a year ago',
          text: 'A wide variety of craft beers. Lemon sour was also fashionable and delicious.\nPotato salad had a whole half-boiled egg on it, and it was fun to break it to make a yolk waterfall.\nThe interior is clean and indirectly lit, making it comfortable and good for dates.\nThere was also a standing drinking seat, and it was a shop that could handle various scenes.',
