          rating: 5,
          relative_time_description: 'a week ago',
          text: 'Perfect beer house with 20 plus draft and dozens of bottle/can options. Bar food is nice too. Friendly staff although zero English tried the best to communicate with customers. One of the most relaxing and pleasant night in Japan. Definitely a must go/revisit In Kyoto!',
