          rating: 3,
          relative_time_description: 'a year ago',
          text: 'Neat place. Unique standing bar, with a few seating options. I tried their Sour, but there was nothing sour about it, and their Barley Wine, which missed the mark. Good news is they have tons of craft options in bottle, but be prepared to pay for those bottles!',
