          relative_time_description: '5 years ago',
          text: 'Fashionable craft beer and meat shop.\n\nThe taste is normal, but\nIf there was a little more validation on the menu, beer would also go ahead.\nBecause it is craft beer, the price is high and it is not a place where you can drink a lot.',
