          text: 'Some of the best craft beer I’ve come across in Japan, and I don’t say that lightly. I had 2x flights and I’d order any of the beers as a full serving. The owner was very welcoming and warm. Rachel also got a great cider, decent pizza and an amazing side salad. Atmosphere was quiet and cozy.',
