          rating: 4,
          relative_time_description: 'a year ago',
          text: 'Sake and beer tasting among other drink and food they offer. It is along the way to the temple so it’s nice to stop by. Though the sake kinda tasted all the same or maybe we just didn’t have the observant sense of taste. Ambiance is fancy which says the same for price as well. They offer English menu.',
