          rating: 5,
          relative_time_description: '3 years ago',
          text: "Randomly ran into this cute spot for light food and drinks on our way from our hotel to the temple that is situated up the hill. The hours are limited, but it was so intriguing that we made sure to make a stop when it was open. Didn't get a chance to try any food, but I always like to sample local beer when able, and wasn't disappointed. If you are in the area, drop by.",
