          rating: 5,
          relative_time_description: 'a month ago',
          text: "What a great bar in Kyoto!  If you love sake, don't know if you love sake, or just like good conversation and great music, then you should head to Bar Windmill.\nThe owner has a wide array of nihonshu (and beers) from around the country, and a tasting set to see what style you like. Always great tunes, like hanging out in your cool Japanese uncle's bar.\nFriendly to foreigners, locals, sake experts and novices alike.  Highly recommended.",
