          rating: 5,
          relative_time_description: '3 years ago',
          text: 'Owner/bartender is awesome and has great sake recommendations!  Classic rock theme with a "menu" where you can choose your preferred music.  Whole family had a blast and discovered new great sake!  The best fried rice I have EVER had.',
          time: 1553514748,
