          rating: 5,
          relative_time_description: '2 weeks ago',
          text: 'Cozy little record bar to enjoy some Japanese craft beer with great music playing on turntables. The owner is very welcoming, the atmosphere very pleasing. I was even allowed to have him played a record I bought this day which made the moment even more special. Highly recommended for people with limited Japanese level like me.',
