          rating: 5,
          relative_time_description: '2 weeks ago',
          text: "This is a decently nice hostel. I really enjoyed my stay here as the downstairs restaurant/bar area is a super chill place to work and hangout. The rooms themselves are clean and have fresh/clean bedding, which is nice to have. The front desk is very nice, and had a strong level of English communication which makes it easier to get help with shifting in. The washrooms are also very clean with showers being exceptionally clean. One improvement is the layout of the rooms, they seemed a bit packed with the bunk beds, however if you aren't gonna spend too much time in the beds that won't be an issue. Another area would be to have a dedicated tour guide in the area would be nice!",
