          rating: 5,
          relative_time_description: '4 years ago',
          text: "Very friendly, multi-lingual staff - very good food and extremely popular.\n\nThe Chicken Pesto Pizza was really good - and I devoured the crust! The Caesar Salad was fresh, topped with bacon, fresh parm, homemade dressing and poached egg. I didn't get a photo of the whole salad and what is pictured is my second serving (there were two of us). The Sweet and Sour Fries were not my thing, but my dining partner really enjoyed them. I would prefer just sour cream rather than the sweetened version they served - clearly just a matter of personal taste.\n\nI did not try any of the craft beers, but the place was packed and I only heard good comments from neighboring tables. I highly recommend a look at the art on the walls - there are some surprises.\n\nOur waiter spoke perfect English and the menu was available in English.Reservations are accepted.",
          time: 1520995326,
