          rating: 4,
          relative_time_description: '4 years ago',
          text: 'Drinks are great. There were only five kinds of craft beer when i visited but all were fine in quality. The food was average and took around 20min until served, but was quite reasonable and went well with the drinks. And the staffs! They were so friendly and kind! Most were multi-lingual as well.\nThe restaurant is 5 min from Kyoto Station, and serves food until 22:00. Drinks were available until a little later (23:00?). Great for getting a drink and a small snack at a reasonable price if staying around the station.',
          time: 1523887730,
