          text: 'This is a river side facility in residence neighborhood.\n\nLiked the Match IPA a lot!!\n\nThe karaage too is a must have.\n\nThey adopted a order and pay first system, but the service is quick.\n\nTry the matcha IPA if they hv it on menu,\nThe taste has match by fragrance, not by taste, try tasting it by itself to give best tasting experience.',
