          rating: 4,
          relative_time_description: 'a year ago',
          text: 'Located in Chita-Okada historic preserved district, this restaurant is modern but have traditional Japanese elements. Though a little bit far away from any train service, there is a local bus stop. Both foods and CBs are reasonably priced. CBs are served on tap and in bottle, also to go. All CBs have fruit ingredients low malt. Avoid wknds to enjoy CBs -part-time staff are busy and unfamiliar with CBs.',
