          rating: 5,
          relative_time_description: '4 months ago',
          text: "I've been wondering about this for a long time, so I bought it for the first time!\n\nI had an errand nearby, so when I tried to stop by, it was closed, so I bought it at a nearby convenience store. by chance? I bought UME SAISON and ICHIJIKU WEIZEN because they were selling at a trial price. I drank UME, but it was fragrant and very refreshing and delicious! It's an easy-to-drink low-malt beer for women. I'm looking forward to drinking figs too!\nI want to buy from the store next time",
