          rating: 3,
          relative_time_description: '3 years ago',
          text: "I was there with some colleagues. The beer is very good (I can judge it because I'm German 😂), I think they have a German Braumeister. Dinner was okay but far away from Japanese food quality which I know and love. Nevertheless going there for having some beer is okay.",
          time: 1562415877,
