          rating: 3,
          relative_time_description: '3 months ago',
          text: "I entered the store first when it opened at noon.\nI was expecting it because there are people who have very high evaluations\nThe food has cooled to room temperature.\nIt feels like it's been a while since the taste has faded.\ndid you make this morning? when did you make it\n\nThe boiled and sausage and fried chicken were delicious.\nIt feels like a local all-you-can-eat in a tourist area.\n\nThe buffet is 1750 yen for adults, but unfortunately I don't think the cost performance is good.",
