          rating: 4,
          relative_time_description: '3 years ago',
          text: 'A craft beer maker that started brewing at the same time as the ban on craft beer was lifted. At that time, it was a LAND BEER brand, but now it has two main brands, Morita Kinshachi Beer and Mitsuboshi Beer. We also offer OEM.\nMorita Group, the parent company, originally produced beer under the Mitsuboshi Beer brand during the Meiji era, but soon withdrew. With the lifting of the ban on local beer in the Heisei era, I have been trying to make beer again and have continued to this day.\nAs a Kinshachi brand, the red miso lager, which uses local red miso, is a representative beer. A surprisingly good beer with the richness and flavor of miso.\nThe Mitsuboshi brand focuses on orthodox German-style beers. Pilsner is especially good.\nAll beer here is sold in snap-on bottles, so you can drink anywhere without a bottle opener.',
