          rating: 4,
          relative_time_description: '10 months ago',
          text: "I've been doing it since snack time, that is, I can drink snack beer. I thought it would be nice to have a little more variety of snacks, but it seems like it's okay to bring your own. You can go in peace and relax. All the beers are the same price, so there are beer coupons (ﾟдﾟ)!",
