      reviews: [
        {
          author_name: 'steve b',
          author_url: 'https://www.google.com/maps/contrib/101725109999560925968/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a/AEdFTp5bDfG5toPmq8YBZXc2cvAdxAunZT6XWtHYldzW=s128-c0x00000000-cc-rp-mo-ba3',
          rating: 5,
          relative_time_description: '5 years ago',
          text: 'Nice beer, good chicken.',
          time: 1504096233,
        },
        {
          author_name: 'Y K',
          author_url: 'https://www.google.com/maps/contrib/105919268318632483070/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCl5n42agYRxpBLsNPEXQzqCY_kA-jNZ58X2JVRIaQ=s128-c0x00000000-cc-rp-mo-ba6',
          rating: 4,
          relative_time_description: '6 months ago',
          text: '今池で太らない食べ物を食べに行こう！\nとなり…焼鳥屋さんに行きました。\nホルモン焼きとどっちがいい？と聞かれたので焼鳥にしました。 smile\n\nカウンターメインのこじんまりとした味のある素敵なお店。\nサラリーマンさんが仕事後に飲んでそうな感じ。\nこういうの好きです。\n\n今回は盛り合わせをいただきました！\n自分で頼むと偏っちゃうから盛り合わせありがたい。\n頼みすぎも防げるし。 smile\n\n【焼鳥5種盛り】\n★ふんどし\n★うめしそ\n★もも\n★むね\n★そでにく\nそれぞれ良さがあって良き良き。\n食べ比べできるのは嬉しいー。\nうめしそ好きかも。梅が好きなのかな。 smile\n\n★肝オリーブオイル漬け\n酒のあてに。 smile\n\n今回は少ないけどこれで終わり！\nワンオペでされてるから忙しそうだった〜。\n応援したくなる。\nまた行きまーす。今度はもっと食べたい。 LOL\n\na.グラスが可愛かったです。',
          time: 1655703638,
        },
        {
          author_name: 'k k',
          author_url: 'https://www.google.com/maps/contrib/116285113429399225795/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCnE6Msxsb7wPj3ADSmrOWxBxwW0gAHxfk2pIrGDWww=s128-c0x00000000-cc-rp-mo',
          rating: 5,
          relative_time_description: '11 months ago',
          text: "Yakitori and beer are the most delicious!\nI used to go there when I lived nearby.\n\nCraft beer is also connected to 4 taps.\nYou can enjoy various breweries and styles such as Waima and Shonan.\nImaike Beer is a bottled beer. It has an amber feel and goes well with yakitori.\nI used to drink beer all the time, but it seems like it would be fun to drink it with a highball or sour while draining the oil.\n\nYakitori is satisfying in both size and taste! There are rare items, so it's fresh every time I go. The a la carte dishes are also delicious, and you can only eat liver olive oil here!\n\nIt can get noisy when it's crowded, but it's comfortable even if you're alone, so I definitely recommend it to many people★",
          time: 1643068795,
        },
        {
          author_name: 'タカヒロ',
          author_url: 'https://www.google.com/maps/contrib/104241989507296075157/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCkDKsUBzp-UXFbr65frNt78d2XeutYqaalHzRdprA=s128-c0x00000000-cc-rp-mo-ba5',
          rating: 4,
          relative_time_description: '7 months ago',
          text: "one or two in the early evening\nfirst thing first\nI want beer and yakitori\nRelax a little after the second\nWhen you want to drink and eat\nI think it's good.\n\nImaike and Chikusa area first\nYakitori and beer\nI wonder if there is a shop where you can enjoy alone\ni found it when i was looking for it.\nChicken from Shiga Prefecture is used\nI wrote the characteristics of each yakitori at the shop\nThere is a word book and details\nI feel like I'm stuck\nThe shop is small, but you can bake\nReally hot yakitori\nI thought it would be nice to be able to eat it.\nRecommended extreme breast yakitori\nBreast meat is usually dry\nThe breast meat skewers here are juicy\nIt was delicious, other classics\nThe menu was also delicious (´ー`)\n\n*As stated in other reviews\nBecause the general is doing it alone\nIt's good right after opening or when it's vacant\nWhen crowded, it takes time to get out\nI thought it would.",
          time: 1653060019,
        },
        {
          author_name: 'n o',
          author_url: 'https://www.google.com/maps/contrib/105959036400254584351/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a/AEdFTp5gFmKqNsT4Csu_xyvjm4smjkIlufDrYuOYQLeR=s128-c0x00000000-cc-rp-mo-ba6',
          rating: 4,
          relative_time_description: '9 months ago',
          text: 'A small shop with only counter seats and small table seats, located just behind Route Inn (or rather, on the side).\nThe grill is one brick, so it may take some time from the time you place your order to the time it\'s cooked when it\'s crowded.\n\nThat should be it!\n\nThe older brother who is baking (you can call me older brother because he is young) is doing it all by himself.\nAlso, it is very carefully baked one by one while checking the degree of heat rotation and cooking.\n\nThis is a nerve-wracking task.\n\nAll of the carefully grilled skewers were "excellent!"\n\nThis time I almost impulsively stopped by the counter and ate, but someday I want to visit this restaurant as the main one.\n\nI also enjoy craft beer.\n\nDiscover a famous store casually nestled in the lining!\n\nBecause there is this, new development, I can not stop!\n\nThank you for your meal!',
          time: 1647849679,
        },
      ],
