          rating: 4,
          relative_time_description: 'a year ago',
          text: 'It’s nice. Small, personal venue. Friendly and knowledgeable staff. The beer was good, a little overpriced if I’m honest but sometimes it’s good to support small independent places like this. Only problem is, like every other craft beer place, it’s a lottery as to whether or not you’ll end up sitting within earshot of some pretentious berk getting high on the pineapple and almond notes in his own farts. Take earplugs just in case.',
