          rating: 5,
          relative_time_description: '2 years ago',
          text: 'The best hamburger I\'ve have in Japan. The closet to the "real thing" as well. I initially came here for the good selection of local cider and beer. But I could see the owner\'s passion for cooking, and one thing led to another.',
          time: 1580816997,
