          rating: 4,
          relative_time_description: '4 years ago',
          text: 'GRILLMAN was a burger joint by day, and a restaurant by night, with a wide selection of craft beer and Japanese wine. It is owned by Sake no Okadaya, which also runs Y. Market Brewing, Keg Nagoya and some other locations outside of the city. The full menu of burgers is only available at lunch, and at night, even additional toppings are off limits. This was a regular lunch spot for me because it’s near my office. Unfortunately, as of August 2018 they completely stopped offering lunch.',
