      reservable: true,
      reviews: [
        {
          author_name: 'Joe Kotrly',
          author_url: 'https://www.google.com/maps/contrib/111853148862174058445/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCn9t3ibKLpIlFUny1-MBl3MZ5SvtVrwDNkrCt1RYw=s128-c0x00000000-cc-rp-mo-ba5',
          rating: 5,
          relative_time_description: '7 months ago',
          text: 'If you are looking for a great burger & beer, you should definitely check out Beer Pub Brick Lane.\n\nThe restaurant has a good vibe to it and pleasant atmosphere - great music 🎶.\n\nThe staff are nice and friendly. When you order your food, you need to go to the front counter to  order and pay for your food up front.\n\nThe burger I ordered was delicious. The meat was tender, flavourful and juicy. The bun was nicely toasted and the fries were tasty.\n\nThey have a good selection of craft beers on tap. The selection changes throughout the year (subject to their availability). Each beer has a description about it, which was helpful.\n\nNext time I’m in Nagoya, I’ll be coming here for another delicious burger - enjoy 😊',
          time: 1652846751,
        },
        {
          author_name: 'Ryan McCarthy',
          author_url: 'https://www.google.com/maps/contrib/115700677728754363634/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WClGPuAlb8Va2g8w37VbI7RxsUDDYw78uOTH9FiC-A=s128-c0x00000000-cc-rp-mo-ba5',
          rating: 5,
          relative_time_description: '6 years ago',
          text: 'Brick Lane offers a selection of unique craft beers on tap and a list of fantastic hamburgers. They have two styles of menus, American and Japanese. These menus rotate, but it only affects the sides and not the hamburger list. I had the Hot Crunchy Burger, fries, and a beer. The Burger was excellent; the patty was tasty and the extras good too. I liked the fries, they looked pretty normal when they were delivered, but after tasting them I was hooked.\nI thought the beers and fries were a little over priced, but the Burger was a good deal.',
          time: 1480336021,
        },
        {
          author_name: 'ChaeHyun Lee',
          author_url: 'https://www.google.com/maps/contrib/117649928169698860643/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCkOkA3_R1JZpE_wSxmBUnsS0slHhSsQa6I_rJdW3g=s128-c0x00000000-cc-rp-mo-ba4',
          rating: 3,
          relative_time_description: '2 years ago',
          text: 'Great burger.\nThe onions were really well sautéed.\n\nGinger ale (spicy) is recommended !!\n\nOnly downside is the 1000yen per glass artisan beer 🍺',
          time: 1607520648,
        },
        {
          author_name: 'Matt N.',
          author_url: 'https://www.google.com/maps/contrib/111849630714618231451/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCm2f3t2bF8yvnhzvFXfE0xtvdT2ENvrJ6Ltamnnlzs=s128-c0x00000000-cc-rp-mo-ba4',
          rating: 4,
          relative_time_description: '3 years ago',
          text: "Great beer, tasty burgers! However, we've traveled all over world (@mattglobetrottingfoodie) and this is most expensive craft beer bar/small burger joint. For example, Washington DC max $10 craft beer/Tokyo Baird beer was $10, and here for local beer it's $14! Furthermore, no fries w/ burger is $15. So love taste, beer, and atmosphere but we'll keep hopping (pun) due to cost.",
          time: 1567073540,
        },
        {
          author_name: 'Kevin Dimmig',
          author_url: 'https://www.google.com/maps/contrib/110085256048320211734/reviews',
          language: 'en',
          profile_photo_url:
            'https://lh3.googleusercontent.com/a-/AD5-WCk10wEIN19uymoZrsp04nx3lLT3mCN6ubJXqq_XxBQ=s128-c0x00000000-cc-rp-mo-ba3',
          rating: 5,
          relative_time_description: '3 years ago',
          text: "This place is fantastic! Not only did I have one of the best burgers I've eaten in a long time, but they also have are wonderful selection of craft beers! The staff is incredibly friendly, and the atmosphere is really nice too! It can be difficult to find quality craft beers in Japan, so I'm so happy that I now have this place as an option!",
          time: 1559988277,
        },
      ],
