          rating: 5,
          relative_time_description: '3 months ago',
          text: 'Before the sausage came, Szechuan Szechuan Szechuan Szechuan Szechuan Szechuan Szechuan Szechuan Szechuan Beer and craft beer go well together 👊\n\nThe terrace seats have a nice atmosphere along the river and are recommended for dates.',
