          rating: 5,
          relative_time_description: '8 months ago',
          text: 'The name of the restaurant is "Arabiki", so I thought it would be a place to eat sausages and drink beer. You can only see the stairs from the street, but it is a hidden gem where you can enjoy high-quality food at a reasonable price while gazing at the Horikawa River.',
