          rating: 5,
          relative_time_description: '8 months ago',
          text: 'The ribs were excellent; huge, delicious and tender. Sorry for the messy picture. The other food looked great too. Also the location on the river is beautiful. Service was great with local and international staff. Atmosphere also lively and fun 👍👍👍',
