          rating: 4,
          relative_time_description: '8 months ago',
          text: "I celebrated my birthday here last weeks we had a dinner. The food was good and tasty, you must try their big boy tray also I love how simple and fresh their ceasar salad. The burger was delicious you can choose your side dishes. You can choose the drinks you want. Staff's are accomodating too they know how to  speak english. Best time to visit is at 6pm onwards, we choose the table outside beside the canal river it gives you that chill vibes feeling. A bit pricey so you must finish all the food.",
