          rating: 2,
          relative_time_description: '5 months ago',
          text: 'Amazing food as expected, but sadly the service was quite poor on the night.\nOne guy, Kaisei, was awesome and very accommodating. He picked up all the slack.\n\nThe "manager" (blond westerner) and the rest of the staff seemed to be having an off day, unable to take an order or deliver drinks without me having to remind them or go in the restaurant and find them.\n\nI was told there were some new staff, but they weren\'t getting a lot of direction from their manager, just milling around taking pictures of customers and smoking down the alley. Even when we paid he just stood there in earshot and let Kaisei deal with it all, despite the fact he knew full well we\'d had a few problems with the service.',
