          rating: 5,
          relative_time_description: '3 years ago',
          text: "Some of the best beer in Nagoya (and Japan) can be found in these walls. If you're into beer, this is a must stop.\n\nThe space is warm, welcoming and usually filled with jovial folks in the evening. The outside patio is a nice treating the weather permits.\n\nThere's lots of beer styles to choose from. Some brewed in house and a few guest taps. Over the course of a few hours we had six and each one was delicious. The stouts especially stole my heart.\n\nThe food is perfect for bar snacks, but I wouldn't recommend making a meal here.\n\nBring some friends - or make new ones there - and enjoy.",
