          profile_photo_url:
            'https://lh3.googleusercontent.com/a/AEdFTp6pDm09QDv7uAX1-Qww61pziNgfpLYaAghGxEbC_Q=s128-c0x00000000-cc-rp-mo',
          rating: 5,
          relative_time_description: '2 years ago',
          text: 'Really enjoyed the craft beer selection at this spot.\n\nThey have good beers from\nWest Coast US, Copenhagen, NYC and local Japanese breweries.\n\nSupport them!',
