          rating: 5,
          relative_time_description: '3 years ago',
          text: 'Has a great passion and love for brewing and beer.⚗️\nArtistic space .🖼️\nStaff is very welcoming and warm(⊃｡•́‿•̀｡)⊃\nI was accomadeted in the best fashion. 🎎\nThe beer selection was yummy and offered a well rounded color selection.🎨\nSupports Japanese brewing 🇯🇵\nThe bar and beer was on the top floor 🏬\nThe restaurant was found on the second floor . 🏬\nNot far from the train station🚉\nThis is a nice boutique  size location ▫️◽\nGreat to meet a few friends after work or date nigth. 🙇💏\nThe bar tender is super cool 😎\nWould go back again 🏃',
