          rating: 5,
          relative_time_description: '4 years ago',
          text: "Cool and fancy craft beer place. Here you can find 10 craft beers on tap (mostly american), unfortunately for us 2 were already sold out today. Anyways, the food was amazing, the pulled pork is very very tasty and definitely a recommendation!\nStaff is very friendly and helpful and they have non smoking seating areas too!\nThe staff speaks English, so ordering and booking a table is no problem for foreigners.\nOnly downside, it's quite cool (cold) if you sit downstairs at the bar.",
