          rating: 4,
          relative_time_description: '2 years ago',
          text: 'We came for dinner on a Saturday and were amazed that the place wasn’t that busy. The Gatehouse is a big hotel restaurant on the 15th floor of the JR gate tower. There’s a courtyard area with outside seating, a bar area and comfy dining areas with great views of the city - which we were nowhere near unfortunately! The food is good, not overpriced and nicely presented. It’s a set course (at least ours was) but there’s a lot of variety. The staff are prompt and helpful, and there was even a couple of nice import beers on the menu.',
