          rating: 5,
          relative_time_description: '5 months ago',
          text: 'Edit 8/8/22\n\nWe finally got to make the visit to the actual establishment.  If you like sour beers (or just beer in general), you must stop by here.\n\nEspecially! Beers and tacos! And other Mexican food-the good stuff that can only be found in the Bay Area or Southern California.\n\nJamie and his extended family (to include the many repeat patrons) are the most hospitable folks in the Nagoya night scene! Thanks for the good time!\n\nOriginal:\n\nMany kudos to HopBuds for making delivery so enjoyable and personal for us!\n\nWe can’t wait to actually stop by the venue and have some of the exclusive ones they have on shelf.',
