          rating: 5,
          relative_time_description: '3 years ago',
          text: "The best craft beer shop in Japan with an incredible amount of good bottles and cans and Hudson Valley on tap! If you're a craft beer nerd, coming here is a must! Hopbuds has some highly sought after beers that are readily available. The owner, Jamie, also keeps his personal collection at the shop and while not for sale, he generously opened a few to share with us. Had an amazing time here!",
